import React, { useState } from 'react';
import './Auth.css';

const Auth = () => {
    return (
        <div className="auth-container">
           <div className="auth-contain-in">
                <div className="auth-form">
                    <div className="auth-form-heading">
                    </div>      
                </div>
           </div>
        </div>
    );
};

export default Auth;
